INSERT INTO `courses` (`id`, `title`, `url`, `description`, `icon`, `image`, `category_id`, `duration`, `instructor_id`, `outlet_id`) VALUES
(1, 'Full Stack Web Development', 'full-stack-web-development', '<h2 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">Full Stack Web Development Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In this time of technological revolution, Crafting the best website design, to meet the standard of the current IT market is the need of the 11th hour. It takes substantial study to understand what makes a successful online application and how it affects the market, which is a skill that every web design firm should possess.&nbsp;<strong>ICR</strong>, being the <strong>Biggest IT Center</strong> in&nbsp;Rahim Yar Khan have may some of the greatest and most talented web developers on staff to assist you in creating a website or web application from start.&nbsp;We can claim competence in a variety of web technologies since <strong>ICR</strong> is the top <strong>Web Wevelopment</strong> company in Rahim yar khan.&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 style=\"text-align: center;\"><span style=\"font-size: 14pt;\">What is Website Development?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>\"Website Development\"</strong>&nbsp;is considered the process of creating a website, covering all the aspects, i.e., from markup and code to scripting, network settings, and CMS development.&nbsp;Examples of feature-rich <strong>Web Development</strong> include eCommerce websites, content management systems, and social networks. Common web development programming languages and tools include HTML, CSS, JavaScript, PHP, and MySQL.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Course outline of Web Development courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of two months, Trainees will learn about the basic and advanced tactics in the <strong>Web Development Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong><span style=\"font-size: 12pt;\">1st Month:&nbsp;</span></strong></p>\r\n<p style=\"text-align: left;\"><strong><span style=\"font-size: 12pt;\">Frontend:</span></strong></p>\r\n<ul>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">(HTML / Bootstrap / Responsiveness)</span><br /><span style=\"font-size: 10pt;\">(bootstrap - basic tags, style and semantics, lists, images,</span><br /><span style=\"font-size: 10pt;\">audio and video, forms, frames, tables, formatting, animation,</span><br /><span style=\"font-size: 10pt;\">Grid system) (CSS - basic properties, advance properties, flexbox,</span><br /><span style=\"font-size: 10pt;\">media queries),(JAVA script)</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\">Backend:</span>&nbsp;</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Basic CRUD in Core PHP&nbsp;</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">JavaScript events and ajax&nbsp;</span><br /><span style=\"font-size: 10pt;\">(JavaScript Statements, Expressions, Conditions and Loops,</span><br /><span style=\"font-size: 10pt;\">JavaScript Objects,Functions, Arrays and Events, jQuery AJAX Calls</span><br /><span style=\"font-size: 10pt;\">(load (), get (), post (), ajax (), get JSON (), getScript()</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>2nd Month:&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">CRUD in Framework&nbsp;</span></li>\r\n<li><span style=\"font-size: 10pt;\">Fully Dynamic Website</span></li>\r\n<li><span style=\"font-size: 10pt;\">Sessions and Cache<br /><br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">SQL Joins</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">API Development</span></li>\r\n<li><span style=\"font-size: 10pt;\">Calling third party API<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Proposal submission</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">Benefits of Web Development Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Web Development</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the programming languages if you want to develop advanced-level websites. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<h1 style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><strong><br /><br /></strong></span></h1>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong id=\"docs-internal-guid-ea7d9f19-7fff-ac33-eb4c-cca6bcfe5b94\"><br /><br /></strong></h1>', 'ffb41c211-web-development.jpg', '4624bf261-web-dev.webp', 1, '3 Month', 17, 9),
(14, 'Front end Development', 'front-end-development', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Front End Web Development Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In this time of technological revolution, Crafting the best website design, to meet the standard of the current IT market is the need of the 11th hour. It takes substantial study to understand what makes a successful online application and how it affects the market, which is a skill that every web design firm should possess.&nbsp;<strong>ICR</strong>, being the <strong>Biggest IT Center</strong> in&nbsp;Rahim Yar Khan have may some of the greatest and most talented web developers on staff to assist you in creating a website or web application from start.&nbsp;We can claim competence in a variety of web technologies since <strong>ICR</strong> is the top <strong>Web Wevelopment</strong> company in Rahim yar khan.&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-size: 14pt;\">What is Website Development?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>\"Website Development\"</strong>&nbsp;is considered the process of creating a website, covering all the aspects, i.e., from markup and code to scripting, network settings, and CMS development.&nbsp;Examples of feature-rich <strong>Web Development</strong> include eCommerce websites, content management systems, and social networks. Common web development programming languages and tools include HTML, CSS, JavaScript, PHP, and MySQL.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of Web Development courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of two months, Trainees will learn about the basic and advanced tactics in the <strong>Web Development Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h4 style=\"text-align: left;\"><span style=\"font-size: 12pt;\">HTML / CSS:&nbsp;</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Introduction to Web Development, Website, Web Platforms, Web App</span></li>\r\n<li><span style=\"font-size: 10pt;\">Frontend Development, Backend Development, Full Stack Development</span></li>\r\n<li><span style=\"font-size: 10pt;\">Basics of HTML Elements (Headings, Paragraphs &amp; Images, Lists, Tables)</span></li>\r\n<li><span style=\"font-size: 10pt;\">Basics of CSS Properties and HTML attributes</span></li>\r\n<li><span style=\"font-size: 10pt;\">HTML Text Formatting, Links, Entities and Inline vs Block Level Elements</span></li>\r\n<li><span style=\"font-size: 10pt;\">Creating and Using CSS Styles: Inline CSS, Internal CSS &amp; External CSS</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS3 Box-Model: Padding, Margin, Outline, Border, Background</span></li>\r\n<li><span style=\"font-size: 10pt;\">Creating Forms to Collect Data from Users using HTML5 &amp; CSS3</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS ID, Class &amp; Contextual Selectors, Attr Selectors</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS3 Floating, Positioning, Overflow, Image-Opacity</span></li>\r\n<li><span style=\"font-size: 10pt;\">Layering Elements with the Z-Index, Flex</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS Pseudo-class, Pseudo-element, CSS Navigation Bar, Dropdowns</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS Animations, Buttons, Multiple Columns, Box Sizing</span></li>\r\n<li><span style=\"font-size: 10pt;\">iframe to Display Web-Pages, Map, Embed Youtube Video</span></li>\r\n<li><span style=\"font-size: 10pt;\">CSS3 Media Queries in Detail &amp; Creating fully Responsive Web Pages</span></li>\r\n<li><span style=\"font-size: 10pt;\">Cross Browsers Compatibility</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Potential Gigs:</span></h4>\r\n<p><span style=\"font-size: 10pt;\">You can create a gig for webpage design with HTML &amp;</span><br /><span style=\"font-size: 10pt;\">CSS, Convert PSD to HTML &amp; CSS, Write clean code for your website in</span><br /><span style=\"font-size: 10pt;\">HTML &amp; CSS, Debug HTML &amp; CSS code.</span></p>\r\n<h4>&nbsp;</h4>\r\n<h4><span style=\"font-size: 12pt;\">Bootstrap 5 &amp; Javascript:</span>&nbsp;</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Introduction to UI libraries &amp; Bootstrap</span></li>\r\n<li><span style=\"font-size: 10pt;\">Get started with Bootstrap Grid System in Detail</span></li>\r\n<li><span style=\"font-size: 10pt;\">Bootstrap Content Typography, Tables, Images, and Buttons</span></li>\r\n<li><span style=\"font-size: 10pt;\">Bootstrap for Creating Elegant Forms to collect user data &amp; data validation</span></li>\r\n<li><span style=\"font-size: 10pt;\">Bootstrap Components Navbars, Dropdown, Cards and Models</span></li>\r\n<li><span style=\"font-size: 10pt;\">Bootstrap Carousel, Sliders, Offcanvas &amp; Scrollspy<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Bootstrap Helper Classes &amp; Utilities<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Introduction &amp; Getting Started with JavaScript<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">JavaScript Variables, Data Types, Operators &amp; Events<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Working with Strings, Numbers, and Conditional Statements<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">JavaScript Objects, Arrays, Loops, Functions<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Understanding the Document Object Model (DOM) in JavaScript<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Understanding the Browser Object Model (BOM) in JavaScript<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Assessments of JavaScript</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\">Potential Gigs:</span>&nbsp;</h4>\r\n<p><span style=\"font-size: 10pt;\">You can create a gig for full website design with HTML,</span><br /><span style=\"font-size: 10pt;\">CSS, Bootstrap &amp; JavaScript, Convert PSD to fully responsive website</span><br /><span style=\"font-size: 10pt;\">design, Redesign a website with Bootstrap.</span></p>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Javascript Advance &amp; JQuery :<strong>&nbsp;</strong></span></h4>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Testing and Debug a JavaScript Applications</span></li>\r\n<li><span style=\"font-size: 10pt;\">Inspection Tools (Elements, Console, Sources, Network, Application)</span></li>\r\n<li><span style=\"font-size: 10pt;\">Create object-oriented JavaScript applications</span></li>\r\n<li><span style=\"font-size: 10pt;\">Using Regular Expressions, Handling Exceptions and Validating Data</span></li>\r\n<li><span style=\"font-size: 10pt;\">Events, Images, and Timers, Closures, Callbacks and Recursion</span></li>\r\n<li><span style=\"font-size: 10pt;\">Events: Hide/Show, Fade, Slide, Animate, Toggle, CSS</span></li>\r\n<li><span style=\"font-size: 10pt;\">Selecting and Manipulating DOM Elements with jQuery</span></li>\r\n<li><span style=\"font-size: 10pt;\">Using jQuery for Event Handling, Basic Animations and Effects</span></li>\r\n<li><span style=\"font-size: 10pt;\">Pre loader</span></li>\r\n<li><span style=\"font-size: 10pt;\">Push you site on live server (Domain &amp; Hosting) Free Domain</span><br /><span style=\"font-size: 10pt;\">000webhost</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\">Potential Gigs:</span></h4>\r\n<p><span style=\"font-size: 10pt;\">You can create a gig for writing scripts for clients<br />requirements, Add JavaScript &amp; jQuery Libraries to level up the user<br />experience, Add Sliders &amp; done Script based tasks, Debug JavaScript<br />code</span></p>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Addons/Plugins &amp; Project:</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">AOS (Animate On Scroll Library)</span></li>\r\n<li><span style=\"font-size: 10pt;\">Animate CSS</span></li>\r\n<li><span style=\"font-size: 10pt;\">Form Validation</span></li>\r\n<li><span style=\"font-size: 10pt;\">Datatables</span></li>\r\n<li><span style=\"font-size: 10pt;\">Dropify</span></li>\r\n<li><span style=\"font-size: 10pt;\">Date Picker &amp; Range Picker</span></li>\r\n<li><span style=\"font-size: 10pt;\">Page smooth scroll &amp; Back to top button</span></li>\r\n<li><span style=\"font-size: 10pt;\">Sweet alerts &amp; Toaster</span></li>\r\n<li><span style=\"font-size: 10pt;\">HTML Meta Tags</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Potential Gigs:</span></h4>\r\n<p><span style=\"font-size: 10pt;\">You can provide your services as a frontend<br />developer for website design, redesign, PSD to HTML, Debug<br />the Code &amp; Fix issues, Customize the code as per clients<br />requirements, Add new features &amp; identify the issues in the current<br />design. In the end, you will perform a final project for the last week<br />which will be compulsory.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of Web Development Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Web Development</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the programming languages if you want to develop advanced-level websites. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<h1 style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><strong><br /><br /></strong></span></h1>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong id=\"docs-internal-guid-ea7d9f19-7fff-ac33-eb4c-cca6bcfe5b94\"><br /><br /></strong></h1>', '354662fb14-web-development.jpg', '809dc6e414-front.jpg', 1, '2 Month', 17, 9),
(2, 'App development', 'app-development', '<h1 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">Mobile App Development</span></h1>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><a href=\"../../../\">ICR</a></strong>&nbsp;is a software-based training institute in&nbsp;Rahim Yar Khan&nbsp;that offers&nbsp;<strong>Mobile App Development Courses. </strong>This Mobile Development COurse is&nbsp;allowing students to improve their abilities in the IT field as Mobile App Developers.&nbsp;Through this&nbsp;Mobile App Development course&nbsp;offered by <strong>IT Center Rahim Yar Khan</strong>,&nbsp;students&nbsp;will be introduced to custom <strong>iOS and Android App</strong> development, native and cross-platform solutions, consulting and prototyping, automated QA and testing, power management, notification and geofencing, Embedded Android and AOSP customizations, and more.</span></p>\r\n<p dir=\"ltr\" style=\"text-align: left;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">What is Mobile App Development?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>Mobile Application Development</strong>&nbsp;is considered the process of developing software applications that operate on mobile devices, which entails building installable software packages (code, binaries, assets, etc.), setting up backend services like data access through an API, and testing the application on target devices.&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"text-align: left;\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Outline of Mobile App Development Course in ICR, IT Centre RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">With this highly demanded course, students will be able to learn different types of mobile app development like</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<ul style=\"list-style-type: undefined;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction to React Native&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Environment (Project) Setup&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Learn React Basics&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Component&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Props&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">State&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">More Essential Components&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Navigation (Stack Navigation)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Navigation (Bottom Bar Navigation)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Navigation (Top Bar Navigation)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Navigation (Side Drawer Navigation)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Combine Multiple Navigations&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Async Storage&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Native Maps and Location API&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Camera and Gallery Access&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Vector Icons and Custom Fonts&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">RN Firebase Implementation&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">App Push Notifications (One Signal)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">React Redux&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Create New Project and Publish it to Github&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">JSON Data Parsing&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to make Network Request?&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Understanding Promises&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Custom Modal / Alerts&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Custom Styling&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">A better way to manage project&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">App deployment to app store &amp; play store&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Collaboration with the web team to develop a complete working solution (1 month)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancing Platforms</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"font-size: 12pt;\">Who Should Attend the App Development Course?&nbsp;&nbsp;</span></strong></p>\r\n<h4 dir=\"ltr\">&nbsp;</h4>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">BSCS (Complete / Continuous)&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Fresh Graduates&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Digital Agency Owner&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<h3 style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Why choose ICR for App Development Course?</span></h3>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR RYK</strong> states that our Mobile App Developers&nbsp;are experienced enough to enable the students to create solutions that satisfy market demands, strengthen corporate brand identities, and promote company development and expansion.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;<strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Pojects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-d92d6364-7fff-0e08-3132-12d3a8ef3cb2\"><br /><br /><br /></strong></span></p>', 'd31eb5602-app-development.jpg', '41c2b6f92-app-dev.webp', 2, '3 Month', 13, 9),
(3, 'Graphic Designing', 'graphic-designing', '<h1 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">Graphic Designing Course</span></h1>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">We can all agree that attractiveness is appealing, and <strong>Graphic Design</strong> conveys glamour to its target audience. It\'s not only about beauty in advertising; there is a tiny window of time for an ad, email, or website to capture the audience\'s attention before they go on to the next item. They\'ll pause to consider the message if something in that brief window catches their attention and causes them to look again (a graphic, a headline).&nbsp;The audience is likely to pay attention to the message in a well-designed marketing item since the Graphics are engaging.&nbsp;By knowing the worth of Graphic Designing for a brand\'s success.&nbsp;<strong>ICR ( IT Centre RYK&nbsp;</strong></span><span style=\"font-size: 10pt;\"><strong>)</strong>has introduced a <strong>Graphic Designing Course</strong> for the people of Rahim Yar Khan.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"font-size: 14pt;\">What is Graphic Designing?</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>Graphic Designing</strong> is \"the art of showing ideas in visual and textual forms.\" These Graphics might be as simple as a corporate logo or as complicated as a page&nbsp;layouts on a website.Through this&nbsp;<strong>Graphic Designing Course</strong>&nbsp;offered by<strong>&nbsp;ICR ( IT Centre Rahim yar khan )</strong> students&nbsp;will&nbsp;be introduced to building custom logos hoardings, book titles and copy covers/labels, company profiles, mockups, cover/headers, Letterhead Pads, Photos, Creatives for Social Media Marketing Campaigns, and User Interfaces for Mobile Apps, Games, Thumbnail Images for YouTube Channels.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h1 style=\"text-align: center;\">Outline of Graphic Designing Course in ICR, IT Center RYK</h1>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Graphic design&nbsp;is a broader term with different branches, which will be taught in ICR (IT Centre Rahim Yar Khan).</span></p>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Like</span></p>\r\n<h4 dir=\"ltr\" style=\"text-align: left;\"><strong><span style=\"font-size: 12pt;\">Adobe Photoshop&nbsp;</span></strong></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Basics of Design</span><span style=\"font-size: 10pt;\"><br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Software Interface &amp; Basics<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Navigation &amp; Usability<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Managing Layers &amp; Transparency<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Clipping Mask<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Social Media Poster Design Basics<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Social Media Designs Sizes<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Type Tool &amp; Character Panel in Details<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Freelancing Session 1 on Poster Design.</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Pen Tool<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Layer Marks<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Adjustments Panel<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Clone Tool &amp; Facial Adjustment Tools<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Content Aware Tools<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Transform Panel<br /></span><span style=\"font-size: 10pt;\"><br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Custom Brushes<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Mockups<br /></span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Adobe Camera Raw</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Freelancing Session 2 Photo Editing, Posters, Refinements etc.</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\"><strong>Adobe Illustrater</strong></span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Software Interface &amp; Basics<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Navigation &amp; Usability<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Layers &amp; Clipping Mask in Ai<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Setting Up Artboard<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Pen Tool<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Image Tracing<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Appearance Panel</span></li>\r\n<li><span style=\"font-size: 10pt;\">Typography<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Shape Builder Tool<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Freelancing Session 3 on Vector Icons, Brochures, Logos &amp; Printing Stuff etc</span></li>\r\n<li><span style=\"font-size: 10pt;\">Path Modification Tools<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Expand &amp; Blend Tool<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Business Card &amp; Brochure Design<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Pathfinder Tool<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Effects Panel<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Custom Brushes<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Final Freelancing Session 4 on Graphic Designing Whole Course Application.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>&nbsp;Eligibility Criteria:</strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<h3 style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Benefits of Graphic Designing course of&nbsp;ICR, IT center RYK</span></h3>\r\n<p style=\"text-align: left;\"><strong><span style=\"font-size: 10pt;\">ICR (&nbsp;</span></strong><span style=\"font-size: 10pt;\"><strong>IT Centre Rahim Yar Khan )</strong> states that at the end of the <strong>Graphic Designing Course</strong>, the student will have all the essential foundations for outlining the ideas and applications designers need to be familiar with and how they integrate into a typical workflow.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>PS:&nbsp;</strong>We also offer practical experience in which students&nbsp;will work on real-world marketing campaigns to boost their expertise and&nbsp;knowledge, as well as grants and <strong>Paid Internships</strong> to our Alumni who showcase good&nbsp;performance during the course.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><br /><br /></strong></span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong id=\"docs-internal-guid-d9711c5b-7fff-6e7f-5c0f-cad87189ed3e\">&nbsp;</strong></h1>', '306178c23-graphic-designing.jpg', 'cc59d6263-graphic-designing.webp', 5, '2 Month', 20, 9),
(4, 'WordPress Development', 'wordpress-development', '<h2 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">WordPress Development Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>WordPress</strong> is a great tool for companies to run their business successfully through a website. According to statistics, 708 million sites out of 1.3 billion are WordPress sites. This amount, which now exceeds 2 million downloads annually, is predicted to increase significantly. To tackle the popularity of WordPress in the IT field, <strong>ICR(IT Centre Rahim Yar Khan )</strong>&nbsp; has stepped in, which is a software-based training institute located in&nbsp;Rahim yar khan&nbsp;that offers&nbsp;<strong>WordPress Development Courses</strong>, allowing students to improve their abilities in the field.&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">What is WordPress Development?</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>WordPress</strong> is a free, open-source website creation platform that does not require computer engineering or any specific degree necessarily.&nbsp;&nbsp;Through this&nbsp;WordPress course,&nbsp;offered by <strong>ICR</strong>, a leading software house in Rahim yar khan,&nbsp;students&nbsp;could create their website without programming, delivering fundamental knowledge about the usage of WordPress dashboards and a solid understanding of basic themes and plugins. Also, it will cover how to use powerful SEO plugins so that you will be found easily online.</span></p>\r\n<h4 style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Upon completion of this WordPress course, you will be able to</span></h4>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Use Basic HTML Elements &amp; CSS Properties</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Setting up/installing Local Server, i.e., XAMPP</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing &amp; Customizing WordPress Themes</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Configuring WordPress setup options</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Using Theme and Plugin directories</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Managing Administrator dashboard</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Customizing Website appearance with code</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing WordPress SEO</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">Create a personal or business website using WordPress and so on</span></p>\r\n</li>\r\n</ul>\r\n<h2 style=\"text-align: center;\"><strong><br /></strong><span style=\"font-size: 14pt;\">Outline of WordPress Development Course in ICR ( IT Centre RYK )<strong><br /></strong></span></h2>\r\n<h2 style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>&nbsp;</strong></span></h2>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>1st Month:&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction to Web Development&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Use of Basic HTML Elements &amp; CSS Properties&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Getting started with WordPress, why choose WordPress?&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Setting up Local Server (Installing XAMPP to create local server)&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Configuring WordPress setup options&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Using Theme and Plugin directories&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Managing Administrator dashboard&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Navigate to the WordPress Dashboard; know what everything does and how to use it.&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing &amp; Customizing WordPress Themes&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Creating Blog content&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Posting on your Blog</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Adding and Managing Categories&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing Plugins - What they are and why do you need them?</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>2nd Month:&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing WordPress Premium theme and Importing demo content&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Editing themes CSS and creating Child Themes&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Creating and embedding Contact Form&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Working with Visual Editor &amp; Page Builders&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Creating a Landing Page with Elementor&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Customizing Website appearance with code&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing WordPress SEO&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Maintaining your website performance&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Keeping your website secure and up to date&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Create a personal or business website using WordPress&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Installing and managing the WooCommerce plugin&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Creating a Simple and Variable Product&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Setting Checkout, Payment gateways, and Shipping Methods&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Backing up your website and exporting your website content&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to buy a domain name and hosting service&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Working with cPanel for File Manager&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Transferring your website to a new domain</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 12pt;\">Benefits of WordPress Development Course for RYK Students</span></h4>\r\n<p><span style=\"font-size: 10pt;\">According to&nbsp;<strong>ICR ( IT Centre RYK )</strong> this <strong>WordPress Development Course</strong> will be the building block to students&rsquo; experience with WordPress, thus creating pathways for them to earn their name in the freelancing platform.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>PS:&nbsp;</strong>We also offer practical experience in which students will work on real-world marketing campaigns to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<h1 style=\"text-align: center;\"><strong id=\"docs-internal-guid-17414819-7fff-33bd-7408-50d9f4b221cd\"><br /><br /></strong></h1>', '4ca441b34-wordpress-development.jpg', '88423a1d4-wordpress-dev.webp', 4, '3 Month', 17, 9);
INSERT INTO `courses` (`id`, `title`, `url`, `description`, `icon`, `image`, `category_id`, `duration`, `instructor_id`, `outlet_id`) VALUES
(5, 'Digital Marketing', 'digital-marketing', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong>Digital Marketing Course</strong></span></h2>\r\n<p><span style=\"font-size: 10pt;\">In this era of digitalization, marketing has become one of the main roads to connect businesses with their customers one-on-one. Whether you want to promote your product online or plan to deliver your services, you have to adopt an advanced approach, leaving the traditional marketing tactics behind, and here comes <strong>Digital Marketing</strong>, your business savior. ICR is a software-based training institute that offers <strong>Digital Marketing Course</strong>&nbsp;students can enrol in to improve their abilities in the field. This course is planned for trainees looking to enhance their mobile and web marketing abilities. <strong>ICR( IT Centre Rahim YAr Khan )</strong> states that the study will help students create and manage online marketing strategies, evaluate the results and improve their social media channels. The <strong>Digital Marketing Course</strong>&nbsp;also aids students in learning the different types of advertising channels and how they can be used to target the market.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">What is Digital Marketing?</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>Digital Marketing</strong> is the practice of advertising products and services through digital channels, such as social media, Search engine optimization, email, and mobile apps. This course is planned by the <strong>ICR, IT center RYK</strong> for students, looking to enhance their mobile and web marketing abilities. Through this digital marketing course in RYK, they will be introduced to the principles, channels, and importance of digital marketing, as well as learn about the tools used in persona creation, competitor research, and website analysis.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 dir=\"ltr\">Outline of Digital Marketing Course in RYK</h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">The Digital Marketing training curriculum is carefully designed to meet the requirements of <strong>Next-Generation Digital Marketing. </strong></span></p>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">The following are covered in training:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>Digital Marketing:&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction to Digital Marketing&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Principles of Digital Marketing&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Digital Marketing Channels&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Importance of Digital Marketing&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Tools to Create Buyer Persona&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Competitor Research Tools&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Website Analysis Tools&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>Social Media Marketing:&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Major Social Media Platforms for Marketing&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Developing Data-driven Audience&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Campaign Insights&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Social Media for Businesses&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Intro to the Creation of Social Media Campaigns&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Optimization of Social Media Campaigns&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>WordPress:&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction to Website Design &amp; WordPress&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">WordPress - Benefits &amp; Features&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Important terms&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Getting started with WordPress.com&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Customizing a blog on WordPress.com&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">WordPress.com - Posts &amp; pages&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Introduction to Self-Hosted WordPress&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Setting &amp; customizing Self-Hosted WordPress&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Self-Hosted WordPress - Posts, Categories &amp; Tags&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Integrating Google Analytics&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Social Media Integrations on WordPress&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Making an e-commerce website on WordPress</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Search Engine Optimization:&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Search Engine Optimization Fundamentals&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Keywords Research&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">SEO Content Plan&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">SEO &amp; Business Objectives&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Writing SEO Content&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">On-site &amp; off-site SEO&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Optimize Organic Search Ranking&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Basics of Technical SEO&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Content Marketing:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Content Marketing Concepts &amp; Strategies&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Planning &amp; Creating&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Marketing Funnels</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Distributing &amp; Promoting Content&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Optimize Website UX &amp; Landing Pages&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Measure Impact&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Using Content Research for Opportunities&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Emails Marketing:&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Newsletters&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Subscribers List&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Email Marketing Tools</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3 dir=\"ltr\"><strong>Benefits of Digital Marketing Course for RYK Students</strong></h3>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>ICR IT Center RY Khan</strong> states that the study will help students to create and manage online marketing strategies, evaluate the results, and improve their social media channels. The course also aids students in learning the different types of advertising channels and how they can be used to target the market through high-ticket digital marketing.&nbsp;</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>PS:</strong> We also offer practical experience in which students will work on real-world marketing campaigns to boost their experience and knowledge as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<h1 style=\"text-align: left;\"><br class=\"Apple-interchange-newline\" /><br /></h1>', '61f7398a5-digital-marketing.jpg', '10969d385-digital-marketing.webp', 3, '2 Month', 22, 9),
(7, 'Software Quality Assurance', 'software-quality-assurance', '<h1 style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>Sofware Quality Assurance</strong></span></h1>\r\n<p><span style=\"font-size: 10pt;\">The life cycle of software development is not complete without software quality assurance (SQA). To meet the rising demand, businesses are consistently producing software applications. People demand high-quality products in addition to a broad range of software options.</span></p>\r\n<p><span style=\"font-size: 10pt;\">To tackle the ongoing challenges in the SQA field,&nbsp;<strong>ICR</strong>, <strong>IT Centre RYK</strong>&nbsp;has introduced the most awaited <strong>Software Quality Assurance Training Course</strong>.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong>What is Software Quality Assurance?&nbsp;</strong></span></h2>\r\n<p><span style=\"font-size: 10pt;\"><strong>Software quality assurance (SQA)</strong> is a process that ensures all software engineering procedures, techniques, tasks, and deliverables are tracked and adhere to the established standards.</span></p>\r\n<p><span style=\"font-size: 10pt;\">Experts from the <strong>ICR&nbsp;IT Centre RYK</strong>&nbsp;created the SQA course in such a way that it will give keen knowledge and hand on practice to the students about the basics of software testing as well as more advanced subjects like software configuration management, developing test plans, test estimations, etc. along with an introduction to and familiarity with automation testing and tools like <strong>QTP and QC</strong>.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong>Outline of Software Quality Assurance Course in ICR, IT Centre RYK</strong></span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">The SQA training course will provide in-depth knowledge of <strong>Software Quality Assurance</strong> by following the course outline, which is specially designed for beginners.</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">The following topics are covered in training:</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>1st Month:</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Basic Concepts of Software Testing.</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Test case &amp; Bug Report Writing.</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;How to use the Application Lifecycle Management Tool (JIRA).&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Requirements Review &amp; Test Scenarios Writing using Trello.</span></li>\r\n</ul>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong>2nd Month:</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Basics of Agile methodologies &amp; Agile Testing&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">How to become a Freelance Tester&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Basics of Performance Testing using JMeter&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Understanding of Appium framework components like <strong>TestNG</strong>, <strong>Maven</strong>, <strong>ANT</strong>, <strong>Jenkins</strong>, <strong>page&nbsp;</strong></span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Object model&nbsp;</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Basic Concepts of automation testing&nbsp;</span></li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>3rd Month:</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;&nbsp;Hand-on experience by Working with a team on a Project.</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Who Should Attend the Training?&nbsp;&nbsp;</strong></span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"text-align: left;\">&nbsp;<span style=\"font-size: 10pt;\">BSCS (Complete / Continuous)&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Fresh Graduates&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Freelancers&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Digital Agency owner&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;IT Professionals&nbsp;&nbsp;</span></li>\r\n<li dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Who Wants their career as SQA Engineer&nbsp;</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp; &nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Benefits of SQA Course for RYK Students:</strong></span></h3>\r\n<h3 style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>&nbsp;</strong></span></h3>\r\n<p><span style=\"font-size: 10pt;\"><strong>ICR IT Center RY Khan</strong>&nbsp;states that the study will provide a golden chance for a practical learning experience with live project work and examples, as students will complete their university projects and be ready to run fast on the job hunt with experience as <strong>Certified&nbsp;SQA Engineers</strong>.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world marketing campaigns to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-3a6f13dd-7fff-128b-465e-144261be09a4\"></strong><br class=\"Apple-interchange-newline\" /></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 12pt;\"><strong><strong id=\"docs-internal-guid-5fae58d7-7fff-5a7d-f6cf-8d45722834db\"></strong><br class=\"Apple-interchange-newline\" /></strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><strong id=\"docs-internal-guid-671e5f1f-7fff-61b0-7ec7-43410b8155cb\"></strong><br class=\"Apple-interchange-newline\" /><br class=\"Apple-interchange-newline\" /></strong></span></p>', '84988d257-software-quality-assurance.jpg', '9dd6b7777-sqa.webp', 6, '3 Month', 27, 9),
(12, 'UI/UX Design', 'ui-ux-design-course', '<h1 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 18pt;\">UI\\UX Design Course</span></h1>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Any firm\'s main objective is to boost sales and business expansion. In order to accomplish this aim, <strong>UI/UX Design</strong> is crucial. The program\'s UI/UX design enhances the user experience and customer happiness, which eventually aids in growing the user base of that particular application.&nbsp;<strong>ICR (IT Center Rahim Yar Khan )</strong> has emerged as the leading software development service in Pakistan. Continuing its legacy of empowering the IT field, it is offering one of the most demanding <strong>UI/UX Design Course</strong>.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-fcff8cb5-7fff-ac0d-2b46-b6076b935b64\"></strong><br class=\"Apple-interchange-newline\" /></span></p>\r\n<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 18pt;\">What is UI/UX Design?</span></h2>\r\n<h4 dir=\"ltr\"><strong><span style=\"font-size: 12pt;\">UI Design:</span></strong></h4>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">The process of enhancing the presentation and interaction of an online or mobile application is known as the <strong>User Interface (UI)</strong>. It concentrates on the appearance of the app and engages users. The UI of a program is represented by each screen, page, button, and other visual component you encounter when using it.</span></p>\r\n<h4 dir=\"ltr\"><strong><span style=\"font-size: 12pt;\">UX Design:</span></strong></h4>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\">The process of enhancing consumers\' entire interactions with an application or website is known as <strong>User Experience (UX)</strong> design, and it aims to maximize customer happiness. It builds the fundamental framework of every program while keeping clients in mind.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Course Contents for UI/UX Design using Figma</span></h3>\r\n<h3 style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>&nbsp;</strong></span></h3>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">UX studies</span></li>\r\n<li><span style=\"font-size: 10pt;\">UX examples in Details</span></li>\r\n<li><span style=\"font-size: 10pt;\">Basics of Design</span></li>\r\n<li><span style=\"font-size: 10pt;\">Software Interface &amp; Basics</span></li>\r\n<li><span style=\"font-size: 10pt;\">Navigation &amp; Usability</span></li>\r\n<li><span style=\"font-size: 10pt;\">Managing Layers &amp; Transparency</span></li>\r\n<li><span style=\"font-size: 10pt;\">Plugins</span></li>\r\n<li><span style=\"font-size: 10pt;\">Community<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Fills &amp; Strokes</span></li>\r\n<li><span style=\"font-size: 10pt;\">Type Tool &amp; Character Panel in Details<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Typography Styles<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\"><strong>Freelancing Session 1 on UX Basics.</strong></span></li>\r\n<li><span style=\"font-size: 10pt;\">Colour Styles<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Effects Panel</span></li>\r\n<li><span style=\"font-size: 10pt;\">Alignment &amp; Spacing<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Intro to components</span></li>\r\n<li><span style=\"font-size: 10pt;\">Wireframing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Figjam<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\"><strong>Freelancing Session 2 on UX/UI&nbsp;</strong><strong>(Wireframing etc).</strong><br /> </span></li>\r\n<li><span style=\"font-size: 10pt;\">Grids<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Design System<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Mobile App Designing<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Designing in Modules</span></li>\r\n<li><span style=\"font-size: 10pt;\">Designing Sections<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Website Design Components<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Setting Up Artboard<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\"><strong>Freelancing Session 3 on Web/App UI.</strong><br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Pen tool &amp; Object Pathfinder<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Working in Frames<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Basics of Auto Layout<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Prototyping<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Padding and Margins<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Auto-Layout Properties<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Resources Websites<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Understanding the client requirements<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Translating requirements to Design<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\"><strong>Freelancing Session 4 on UI.</strong></span></li>\r\n</ul>\r\n<p><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<h4 dir=\"ltr\"><span style=\"font-size: 12pt;\">Teaching Methodology&nbsp;</span></h4>\r\n<ul style=\"list-style-type: undefined;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Explanation of Topics on the Whiteboard by the Trainer</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">All Technical Steps are Performed Live on Screen</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Spontaneous Answers to the Questions by Students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Active Class Discussion and Engagement</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 18pt;\"><strong>&nbsp;</strong></span></p>\r\n<h4 dir=\"ltr\"><span style=\"font-size: 14pt;\">Who Should Attend the Training?</span></h4>\r\n<h4 dir=\"ltr\">&nbsp;</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Marketing Students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Fresh Graduates</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Management Students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Business Owners</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Web Designers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Management Professionals</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Company Employees</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Web Developers</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<h3 dir=\"ltr\"><span style=\"font-size: 14pt;\">Why is UI/UX so Important?</span></h3>\r\n<p><span style=\"font-size: 10pt;\">The main reason why<strong> ICR ( IT Center RYK )</strong> is conducting<strong> UI/UX Design Courses</strong> is these designers are among the most sought-after jobs in technology because they are involved in so many phases of a project\'s life cycle. According to 87 percent of hiring managers, finding UX Designers is a top priority.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>&nbsp;</strong></span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our alumni who showcase good performance during the course.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-8c3f6772-7fff-7677-fb4d-a2b84c1db5e7\"></strong><br class=\"Apple-interchange-newline\" /></span></p>\r\n<h2 style=\"text-align: center;\">&nbsp;</h2>', 'c574494112-ui-ux-course.jpg', 'c2f74dcc12-ui-ux.webp', 12, '2 Month', 23, 9),
(13, 'Search Engine Optimization (SEO)', 'search-engine-optimization-course', '<h1 style=\"text-align: left;\"><strong><span style=\"font-size: 18pt;\">Search Engine Optimization(SEO) Course</span></strong></h1>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\">The success of most businesses\' websites depends greatly on organic search, which is also a vital aspect of the buyer\'s funnel and helps visitors to complete conversions or interact with the brands. Knowing the importance of <strong>SEO</strong> in business success, <strong>ICR( IT Centre Rahim Yar khan )</strong>, a leading software house in Rahim yar khan, has decided to bring SEO training into their courses.</span></p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong id=\"docs-internal-guid-ccbfbc30-7fff-5069-e577-8d088da9b4b2\">What is Search Engine Optimization(SEO)?</strong></span></h2>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Search engine optimization (SEO)</strong> ranks your website higher on a search engine results page (SERP) to generate more traffic/ Visitors.&nbsp;In the sphere of digital marketing, it is regarded as the most desirable employment option. Many businesses worldwide use SEO specialists to create better content and, as a result, increase the number of business leads.&nbsp;Through this&nbsp;SEO course&nbsp;offered by&nbsp;<strong>IT Center Rahim yar khan</strong>,&nbsp;students&nbsp;will be introduced to the fundamentals of SEO, including, Keyword searching, Content planning, usage of free &amp; paid tools for keywords analysis, content optimization, and so on.</span></p>\r\n<h3 style=\"text-align: left;\"><span style=\"font-size: 14pt;\"><strong id=\"docs-internal-guid-7789ec14-7fff-b381-67fb-56180b81a255\">Outline of SEO Course in ICR, IT Centre RYK</strong></span></h3>\r\n<p><span style=\"font-size: 10pt;\"><strong>Search Engine Optimization</strong>&nbsp;is a broader term with different branches, which will be taught in <strong>ICR (IT Centre Rahim Yar Khan)</strong>, i.e., On-Page, Off-Page SEO, Local SEO, Technical, YouTube, and Avoid Negative SEO.&nbsp;With these SEO types, this course has a brief content outline to be taught to its students.</span></p>\r\n<h4>&nbsp;</h4>\r\n<h4><span style=\"font-size: 10pt;\"><span style=\"font-size: 12pt;\">Module 1: Introduction To SEO</span></span>&nbsp;</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What is a search engine?</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What Is SEO?</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What is the need for SEO?</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">History Of SEO</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How SEO Works</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What is Googlebot (Google Crawler)</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Types of SEO techniques</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What are Google\'s SEO Algorithm updates?</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What are SEO tools, and why do we need them?<strong><strong id=\"docs-internal-guid-977ed547-7fff-395b-4e09-a18005ac96bd\"></strong><br class=\"Apple-interchange-newline\" /></strong></span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Module 2: Niche Research</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Market Research</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Niche Evaluation</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Initial Profitability Assessment</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Different Process of Niche Research.</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">How to Find Profitable Niches.</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Ever Green Niches.</span></p>\r\n</li>\r\n</ul>\r\n<p><span style=\"font-size: 10pt;\"><strong><strong id=\"docs-internal-guid-55b17d64-7fff-7d71-8b12-32adec0cc6af\">&nbsp;</strong></strong></span></p>\r\n<h4><span style=\"font-size: 12pt;\">Module 3: Keyword Research Process</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">What Is Keyword</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">The importance of Keyword Research?</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Different types of Keywords.</span></p>\r\n</li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">What is Intent?</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to do Analysis of keywords using Free &amp; Paid Tools.</span><span style=\"font-size: 10pt;\"><br /></span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to find easy to rank keywords related to your website and&nbsp;</span><span style=\"font-size: 10pt;\">business.</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How Ms Excel will help finding valuable keywords of our market.</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to do Analysis of Keywords Using Chrome Extension.</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to find the Ranking Keyword of Competitors.</span><span style=\"font-size: 10pt;\"><br /><br /></span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Selecting the right keywords for the project.</span></li>\r\n</ul>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">How to use AI tools like (ChatGPT) for keyword research methods</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-afad9b30-7fff-1d2f-696d-6688d5ede5dc\">&nbsp;</strong></span></p>\r\n<h4><span style=\"font-size: 12pt;\">Module 4: Competitive Analysis</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">How to Analyze our Competitive Landscape</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to identify our Competitors</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to Extract and align data of our competitors</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to Visualize your competitors Data</span></li>\r\n<li><span style=\"font-size: 10pt;\">What will be your Strategy</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Module 5: Content Planning and Creation</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Content Research<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Content Structure<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Content Planning with Keywords<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Content Brief</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Module 6: On-Page SEO&nbsp; Module</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">What is On-Page SEO?</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">On-page SEO checklist</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Title Optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Content optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Header Tags Optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Meta Description optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Image optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Internal links</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Outbound links</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Schema Markup</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4 dir=\"ltr\"><span style=\"font-size: 12pt;\">Module 7: Off-Page SEO</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">On page Vs. Off-Page Optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Introduction to Backlinks: Why is it important for SEO?</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">What is Anchor text, and why is it important in link building?</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">When should you start creating backlinks</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Some proven ways to get backlinks organically</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Easy Method to generate high-quality Do-follow backlinks</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Social media submission</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Module 8:&nbsp;Website Audit</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Technical Audit</span></li>\r\n<li><span style=\"font-size: 10pt;\">On-page Audit</span><span style=\"font-size: 10pt;\"><br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Off -Page Audit</span></li>\r\n<li><span style=\"font-size: 10pt;\">Reporting</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Module 9: Local SEO</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 12pt;\">What is local SEO, and why is it important</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Important Local SEO factors</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Setup of Google My Business (GMB)</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">How to optimize GMB Listing</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Important elements you must optimize on the GMB listing</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Citations: What is citation &amp; Benefits of citations in Local SEO</span></p>\r\n</li>\r\n</ul>\r\n<p><strong id=\"docs-internal-guid-9d8e1d1d-7fff-b0a3-d9bb-9a788833597f\"></strong><br class=\"Apple-interchange-newline\" /><br /></p>\r\n<h4><span style=\"font-size: 12pt;\">Module 10: Technical SEO</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">What Is Technical SEO</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Technical SEO Ranking factors</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Type of meta tags and their effect on SEO</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Site architecture Optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Breadcrumbs </span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Permalinks optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Canonicalization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">What Is Robots.txt File &amp; How to create it</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">How to Improve Website Performance &amp; Speed using a Plugin</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">How to perform the Page Speed Test</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">XML and HTML sitemap creation and optimization</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">How to Add and verify a website in Google Console</span></p>\r\n</li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Google Analytics setup and monitoring</span><strong id=\"docs-internal-guid-9c70d1c5-7fff-e18a-4b06-cd90e2ca0073\"></strong><br class=\"Apple-interchange-newline\" /><br /></li>\r\n</ul>\r\n<p><span style=\"font-size: 12pt;\">&nbsp;</span></p>\r\n<h4 dir=\"ltr\"><span style=\"font-size: 12pt;\">Eligibility Criteria</span></h4>\r\n<p>&nbsp;</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Metric/ FSC students</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">Freelancers</span></p>\r\n</li>\r\n<li dir=\"ltr\">\r\n<p><span style=\"font-size: 10pt;\">IT Professionals</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong id=\"docs-internal-guid-a6c8d6b6-7fff-bfa4-3b01-06d2fb62ce1b\"></strong><br class=\"Apple-interchange-newline\" /></span></p>\r\n</li>\r\n</ul>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of SEO For Students of ICR</span></h3>\r\n<p><span style=\"font-size: 10pt;\"><strong>ICR (IT Centere RYK)</strong> states that at the end of the course, the student will have all the essential foundations to kick-start a career in <strong>SEO</strong> for approaching the job market as a Junior SEO specialist.</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world marketing campaigns to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>\r\n<p><span style=\"font-size: 14pt;\"><strong id=\"docs-internal-guid-ffd4f2a5-7fff-0574-52df-f32d3195a498\"></strong><br class=\"Apple-interchange-newline\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10pt;\">&nbsp;</span></p>\r\n<p><strong id=\"docs-internal-guid-39ffaf3b-7fff-6b7e-f7e6-eeee8a5f3009\"></strong><br class=\"Apple-interchange-newline\" /><br /></p>', 'c0310ca213-seo-icon.jpg', '21ba81dc13-seo.webp', 13, '3 Month', 26, 9),
(15, 'Business Development', 'business-development', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Business Development Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">At ICR, our business development course is designed to provide students with the skills and knowledge necessary to succeed in this exciting and dynamic field. Our program covers a wide range of topics, including market research, sales strategies, financial analysis, and marketing</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-size: 14pt;\">What is Business Development?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Business development is identifying and pursuing new opportunities to grow a business. It involves a range of strategies and activities to increase revenue, expand the customer base, and improve overall business performance.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of Business Development courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of 1 Month. Trainees will learn about the basic and advanced tactics in the <strong>Business Development Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h4 style=\"text-align: left;\"><span style=\"font-size: 12pt;\">What is Business Development? <br /></span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Definition of BD and its benefits</span></li>\r\n<li><span style=\"font-size: 10pt;\">BD Position in organization</span></li>\r\n<li><span style=\"font-size: 10pt;\">Business Model Analysis</span></li>\r\n<li><span style=\"font-size: 10pt;\">What is B2B and B2C</span></li>\r\n<li><span style=\"font-size: 10pt;\">Business Ethics</span></li>\r\n<li><span style=\"font-size: 10pt;\">Identify and Research potential clients</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Freelancing Platforms</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Introduction to Freelancing Platforms</span></li>\r\n<li><span style=\"font-size: 10pt;\">Create optimized Profiles on Freelancing platforms</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to search best fit jobs on freelancing platforms</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to win a Job</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to write winning proposal/gig description</span></li>\r\n<li><span style=\"font-size: 10pt;\">Professional Communication with clients</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to write a Business Plan</span></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4><span style=\"font-size: 12pt;\">Linkedin<br /></span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Introduction to LinkedIn, latest trends and development</span></li>\r\n<li><span style=\"font-size: 10pt;\">Create an optimized LinkedIn profile</span></li>\r\n<li><span style=\"font-size: 10pt;\">Create Professional Resume</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to use LinkedIn to grab Leads</span></li>\r\n<li><span style=\"font-size: 10pt;\">What is Sales Navigator</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to communicate with clients via LinkedIn</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to get your First job via LinkedIn</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\">Lead Generation</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Lead generation via Local Market</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to grab Projects from other platforms like Facebook</span></li>\r\n<li><span style=\"font-size: 10pt;\">Practical Implementation of working with a real Client</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li>Marketing Students</li>\r\n<li>Fresh Graduates</li>\r\n<li>Management Students</li>\r\n<li>Freelancers</li>\r\n<li>Business Owners</li>\r\n<li>Web Designers</li>\r\n<li>IT Professionals</li>\r\n<li>Management Professionals</li>\r\n<li>Company Employees</li>\r\n<li>Web Developers</li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of Business Development Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Business Development</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the Business development if you want to develop your business. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>', '73d8d03215-business-development.png', '26c1a80a15-bd.jpg', 15, '1 Month', 32, 9);
