(16, 'Social Media Content Creation ', 'social-media-content-creation-', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Social Media Content Creation Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">At ICR, our social media content creation course is designed to teach students the skills and techniques necessary to create compelling and effective content for social media platforms. Our program covers a variety of topics, including content strategy, social media platform-specific tactics, and analytics.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-size: 14pt;\">What is Social Media Content Creation?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Social media content creation produces and publishes content designed for social media platforms. This type of content can include text, images, videos, and other multimedia elements, and it is designed to engage and inform the audience, drive traffic, and increase brand awareness.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of Social Media Content Creation courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of 2 Months. Trainees will learn about the basic and advanced tactics in the <strong>Social Media Content Creation Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong><span style=\"font-size: 12pt;\">Graphic Design Course Contents <br /></span></strong></p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Basics of Design</span></li>\r\n<li><span style=\"font-size: 10pt;\">Software Interface &amp; Basics</span></li>\r\n<li><span style=\"font-size: 10pt;\">Navigation &amp; Usability</span></li>\r\n<li><span style=\"font-size: 10pt;\">Managing Layers &amp; Transparency</span></li>\r\n<li><span style=\"font-size: 10pt;\">Clipping Mask</span></li>\r\n<li><span style=\"font-size: 10pt;\">Social Media Poster Design Basics</span></li>\r\n<li><span style=\"font-size: 10pt;\">Social Media Designs Sizes</span></li>\r\n<li><span style=\"font-size: 10pt;\">Type Tool &amp; Character Panel in Details</span></li>\r\n<li><span style=\"font-size: 10pt;\">Making Selections with Different tools</span></li>\r\n<li><span style=\"font-size: 10pt;\">Pen Tool</span></li>\r\n<li><span style=\"font-size: 10pt;\">Layer Marks</span></li>\r\n<li><span style=\"font-size: 10pt;\">Adjustments Panel</span></li>\r\n<li><span style=\"font-size: 10pt;\">Clone Tool &amp; Facial Adjustment Tools</span></li>\r\n<li><span style=\"font-size: 10pt;\">Content Aware Tools</span></li>\r\n<li><span style=\"font-size: 10pt;\">Transform Panel</span></li>\r\n<li><span style=\"font-size: 10pt;\">Custom Brushes</span></li>\r\n<li><span style=\"font-size: 10pt;\">Mockups</span></li>\r\n<li><span style=\"font-size: 10pt;\">Adobe Camera Raw</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Social Media Marketing Course Outline:</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Introduction to Digital Marketing.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Google Digital Garage.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Buyers Persona &ndash; SEMrush.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Meta Suite.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Message Automations.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Ads Manager.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Instant Forms - Meta.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Leads Ad - Ads Manager.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Sale SQL.</span></li>\r\n<li><span style=\"font-size: 10pt;\">The Art of Pitching.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Business Profile - Ads Manager.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Meta Pixel: Measure, Optimize &amp; Retarget Ads.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Setup Own Digital Marketing Agency.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Designing Carousel Cards - Canva.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Social Media Content Calendar - MS Excel.</span></li>\r\n<li><span style=\"font-size: 10pt;\">Client-Oriented Strategy - MS Word</span></li>\r\n<li><span style=\"font-size: 10pt;\">Generating Catchy Captions</span>.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of Social Media Content Creation Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Web Development</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the programming languages if you want to develop advanced-level websites. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>', 'b096b22b16-content-creation.png', '66dbb6dd16-content-creation.jpg', 16, '2 Month', 23, 9),
(18, 'Project Management', 'project-management', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Project Management Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">The ICR IT Centre, Rahim Yar Khan, is pleased to present an all-inclusive and top-notch Project Management course. This program is designed to equip aspiring project managers and professionals with a comprehensive understanding of project management principles, methodologies, and tools. Our industry-seasoned and enthusiastic instructors will guide students through the latest project management approaches and technologies. The course curriculum encompasses a broad range of topics, including project planning and scheduling, risk management, quality control, stakeholder management, communication management, and team leadership. Throughout the course, students will participate in hands-on activities, simulations, and real-life case studies to sharpen their project management skills and enhance their problem-solving abilities. By the end of the program, students will have developed a strong foundation in project management, and the skills necessary to effectively manage projects of varying sizes and complexity. Whether you are an aspiring project manager or a seasoned professional seeking to refine your project management skills, this program will provide you with the tools and knowledge to lead successful projects from inception to completion.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of Project Management courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of 1 Months. Trainees will learn about the basic and advanced tactics in the <strong>Project Management Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">&nbsp;Characteristics of Project Management.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Techniques of selecting commonly used methods by seeing the nature of</span><br /><span style=\"font-size: 10pt;\">the project.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">PMBOK Areas to improve project performance.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Name the key stakeholders in a project and determine ways of keeping them</span><br /><span style=\"font-size: 10pt;\">\"on task\" during the phases of the project.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Use an example of Project Charter.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Write SMART project objectives for Project Scope.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Document and clearly communicate project assumptions.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Develop a procedure for managing changes in the project.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Create a Work Breakdown Structure (WBS).</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Monitoring on doing deadlocks and managing them.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Triple constraints.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Calculate the critical path for a project and develop a strategy for keeping the project on track, identify, quantify, and prioritize risks in managing projects.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Create a communications plan.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">How to use tools to measure project progress in terms of time, cost, and</span><br /><span style=\"font-size: 10pt;\">deliverables.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">PRD and Project Sequence.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Develop a strategy for managing project resources by using a responsibility</span><br /><span style=\"font-size: 10pt;\">matrix (RACI) for assigning project activities to resources.</span></li>\r\n<li style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Project Precedents for Success and Failiure with Project Closure.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of Project Management Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Project Management</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the programming languages if you want to develop advanced-level websites. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>', '16fc3c4818-project-managment-01.jpg', '329d7ece18-pm.jpg', 17, '1 Month', 29, 9),
(17, 'Content Writing', 'content-writing', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Content Writing Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">The IT Centre, Rahim Yar Khan, is excited to provide thorough and top-notch Content Writing training, designed to equip students with the knowledge and skills necessary to create compelling and effective written content for a variety of platforms and purposes. Our experienced instructors will guide students through the fundamentals of content writing, covering topics such as tone, style, structure, and more. This course will teach you about several sorts of writing, such as website content writing, blog and article writing, affiliate writing, email writing, product descriptions, and more.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of Content Writing courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of 1 months. Trainees will learn about the basic and advanced tactics in the <strong>Content Writing Course</strong> in ICR RYK.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h4 style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Basic Understanding of Content Writing</span></h4>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h4 style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Types of Content Writing</span><strong><span style=\"font-size: 12pt;\"> <br /></span></strong></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Article Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Blog Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Affiliate Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Descriptive Articles</span></li>\r\n<li><span style=\"font-size: 10pt;\">How To Articles</span></li>\r\n<li><span style=\"font-size: 10pt;\">Product Description</span></li>\r\n<li><span style=\"font-size: 10pt;\">Script Writing</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Website Content Writing</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Website Content Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Understanding Web Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Identifying Website Requirement</span></li>\r\n<li><span style=\"font-size: 10pt;\">Identifying Target Audience</span></li>\r\n<li><span style=\"font-size: 10pt;\">Guideline to Documentation &amp; Formatting</span></li>\r\n<li><span style=\"font-size: 10pt;\">Search Engine Optimization</span></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4><span style=\"font-size: 12pt;\">Blogs &amp; Article Writing</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Difference b/w Blogs &amp; Article Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Types of Article Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to Select Niche for Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Keyword Finding (Manual &amp; Paid Tool)</span></li>\r\n<li><span style=\"font-size: 10pt;\">How to write an Article (Intro, Heading Ideas, Body, Conclusion)</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">Affiliate Writing</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">Brief Description of Affiliate Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Techniques of Affiliate Writing</span></li>\r\n<li><span style=\"font-size: 10pt;\">Selection of ranking Niche</span></li>\r\n<li><span style=\"font-size: 10pt;\">Optimization of Affiliate Writing</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>YouTube Script Writing <br /></strong></span></p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">How to write a YouTube script</span></li>\r\n<li><span style=\"font-size: 10pt;\">Understanding of Hook, Intro, Main Body &amp; Outro</span></li>\r\n<li><span style=\"font-size: 10pt;\">Selection of Niche<br /></span></li>\r\n<li><span style=\"font-size: 10pt;\">Optimization of Script</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<p><span style=\"font-size: 10pt;\">Candidates must possess at least a Matriculation degree and good grip</span><br /><span style=\"font-size: 10pt;\">on English. This training does not require your prior background</span><br /><span style=\"font-size: 10pt;\">knowledge of Information Technology. If you use a computer for Email</span><br /><span style=\"font-size: 10pt;\">Checking or Social Media communications, you are eligible for the training.</span></p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\"><span style=\"font-size: 14pt;\">Benefits of Content Writing Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>Content Writing</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the Content Writing. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>', '87918e8217-content-writing.png', 'c83b5d5f17-content-writing.jpg', 14, '1 Month', 24, 9),
(19, 'React js', 'react-js', '<h2 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">React.js Course</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In this time of technological revolution, Crafting the best website design, to meet the standard of the current IT market is the need of the 11th hour. It takes substantial study to understand what makes a successful online application and how it affects the market, which is a skill that every web design firm should possess.&nbsp;<strong>ICR</strong>, being the <strong>Biggest IT Center</strong> in&nbsp;Rahim Yar Khan have may some of the greatest and most talented web developers on staff to assist you in creating a website or web application from start.&nbsp;We can claim competence in a variety of web technologies since <strong>ICR</strong> is the top <strong>Web Wevelopment</strong> company in Rahim yar khan.&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-size: 14pt;\">What is React.js?</span></h2>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ReactJS</strong> is a popular JavaScript library used for building user interfaces. Developed by Facebook, it allows developers to create reusable UI components and efficiently manage the state of their applications. ReactJS uses a virtual DOM (Document Object Model) to efficiently render changes to the UI without the need to refresh the entire page. It is often used in combination with other libraries and frameworks to build web applications, mobile apps, and desktop apps. ReactJS is known for its simplicity, flexibility, and performance, making it a popular choice for developers looking to build modern, interactive, and scalable user interfaces.</span></p>\r\n<h3 dir=\"ltr\" style=\"text-align: center;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Course outline of React.js courses in ICR, RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In the tenure of 45 Days, Trainees will learn about the basic and advanced tactics in the <strong>React.js Course</strong> in ICR RYK.</span></p>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"font-size: 12pt;\">JavaScript:</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">JavaScript: What and Why?</span></li>\r\n<li><span style=\"font-size: 10pt;\">Core Architecture</span></li>\r\n<li><span style=\"font-size: 10pt;\">Function vs Arrow Function</span></li>\r\n<li><span style=\"font-size: 10pt;\">Event Listeners &amp; DOM manipulation</span></li>\r\n<li><span style=\"font-size: 10pt;\">Form Handling</span></li>\r\n<li><span style=\"font-size: 10pt;\">Data Fetching</span></li>\r\n<li><span style=\"font-size: 10pt;\">Callbacks &amp; Promises</span></li>\r\n<li><span style=\"font-size: 10pt;\">Advanced concepts (Frameworkds,libraries,etc)</span></li>\r\n</ul>\r\n<h4><span style=\"font-size: 12pt;\">React.js:</span></h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span style=\"font-size: 10pt;\">React: What and Why?</span></li>\r\n<li><span style=\"font-size: 10pt;\">Node &amp; NPM, initialize a REact Application</span></li>\r\n<li><span style=\"font-size: 10pt;\">Core Architecture</span></li>\r\n<li><span style=\"font-size: 10pt;\">State &amp; State Management</span></li>\r\n<li><span style=\"font-size: 10pt;\">Side Effects &amp; Effect Handling</span></li>\r\n<li><span style=\"font-size: 10pt;\">Conditional Rendering</span></li>\r\n<li><span style=\"font-size: 10pt;\">Minimal Project</span></li>\r\n<li><span style=\"font-size: 10pt;\">Prop Drilling, cause and effects</span></li>\r\n<li><span style=\"font-size: 10pt;\">Routing: What and Why</span></li>\r\n<li><span style=\"font-size: 10pt;\">UseReducer &amp; Context API</span></li>\r\n<li><span style=\"font-size: 10pt;\">Redux: What and Why?</span></li>\r\n<li><span style=\"font-size: 10pt;\">Advanced Concepts (Lazy Loading, Memoization,etc)</span></li>\r\n<li><span style=\"font-size: 10pt;\">SEO, NEXT.js and Next Steps</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Eligibility Criteria:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: 10pt;\">Metric/ FSC students</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Bachelor/ Master Degree holders</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">Freelancers</span></li>\r\n<li dir=\"ltr\"><span style=\"font-size: 10pt;\">IT Professionals</span></li>\r\n</ul>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Benefits of React.js Course in RYK</span></h3>\r\n<p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>ICR ( IT Centre RYK )</strong> states that the study will help students to create and manage&nbsp;an income source because, due to&nbsp;the rapidly-increasing number of Internet users, it\'s no surprise that <strong>React.js</strong> is a rapidly expanding industry.&nbsp;Do not waste your valuable time ,learn the programming languages if you want to develop advanced-level websites. In this training, you will have to complete your university projects and you will become ready to run fast on the track of the job hunt with experience.&nbsp;</span></p>\r\n<p dir=\"ltr\"><span style=\"font-size: 10pt;\"><strong>PS:</strong>&nbsp;We also offer practical experience in which students will work on real-world Projects to boost their expertise and knowledge, as well as grant <strong>Paid Internships</strong> to our Alumni who showcase good performance during the course.</span></p>', '9ec14c1e19-web-development.jpg', 'feb7dc8f19-reactjs.jpg', 1, '2 Month ', 28, 9);
