INSERT INTO `general_setting` (`id`, `timezones`, `language`, `date_format`, `time_format`, `outlet_id`, `image`, `fav_icon`, `home_image`, `courses_heading`, `home_heading`, `feature_heading`, `footer_logo`, `footer_text`, `address`, `phone`, `email`, `facebook`, `instagram`, `youtube`, `linkedin`, `smtp_user`, `smtp_email`, `smtp_password`, `smtp_port`, `team_heading`, `platform_heading`, `subscriber_heading`, `footer_heading`, `contact_heading`, `contact_desc`, `about_heading`, `about_us`, `map`, `about_short`) VALUES
(11, 'Europe/Copenhagen', NULL, NULL, NULL, 9, NULL, NULL, 'trainee_pos.jpg', 'df', 'Design Your Future with ICR - Where 1000+ Trainees Become Experts', 'dfdf', 'Artboard_12@8x.png', ' ICR is established in the region to provide tools & resources to our students for polishing their skills, Hence making their names in the IT market.', '<a target=\'_blank\' href=\'https://goo.gl/maps/pRZmxFKJBGK71gyX6 \'>Hello World Technologies Building, Canal Rd, near The City School, Rahim Yar Khan, Punjab 64200, Pakistan</a>', '+92302-8882-969', 'info@itcentre.pk', 'https://www.facebook.com/ITCentreRYK/', 'https://www.instagram.com/itcentreryk/', 'https://www.youtube.com/@itcentreryk', 'https://pk.linkedin.com/company/icr-it-center-ryk', '#', '#', '#', '#', 'Making Great Things Possible', 'Exploring following Platforms', 'Stay connected For latest information', 'Most Reliable Technology Provider in the Region', 'Contact Us ', 'Him have deep brought life darkness firmament unto move', 'Welcome to World of Technical Knowledge', '<br/>\r\nICR is a leading IT training institute located in Rahim Yar Khan, Pakistan, which was brought to life by Hello World Technologies, a prominent software house that has been in operation since 2016. Hello World Technologies specializes in providing customized, scalable, and integrated solutions using various enterprise technologies, thereby digitally transforming businesses.\r\n<br/>\r\n<br/>\r\nWith the unprecedented increase in the demand for IT professionals after the COVID-19 outbreak, Hello World Technologies realized the urgent need for a professional platform where students could hone their IT skills and keep pace with rapidly evolving technology. As a result, ICR was established to raise the standard of software houses in the Rahim Yar Khan region.\r\n<br/>\r\n<br/>\r\nICR is committed to providing a one-stop-shop for students to acquire various skills that can enable them to be bread earners without any difficulty. We offer a wide range of training programs, including Full Stack Web Development, App Development, Graphic Designing, WordPress Development, Digital Marketing, Software Quality Assurance, UI/UX Design, Search Engine Optimization (SEO), Front-end Development, Business Development, Social Media Content Creation, Content Writing, Project Management, and React JS.\r\n<br/>\r\n<br/>\r\nAt ICR, we believe in providing our students with a practical learning experience to ensure that they are well-equipped to meet the demands of the industry. Our experienced trainers provide individual attention to students and work with them to develop their technical skills, creativity, and problem-solving abilities.\r\n<br/>\r\n<br/>\r\nIf you are looking to enhance your IT skills or kickstart your career in the field of technology, ICR is the perfect place for you. Our courses are designed to provide you with a solid foundation and enable you to become a successful IT professional. Contact us today to learn more about our training programs and kickstart your journey towards a rewarding career.', 'https://goo.gl/maps/pRZmxFKJBGK71gyX6', '<br/>\r\nICR is a leading IT training institute in Rahim Yar Khan, Pakistan, established by Hello World Technologies. We offer a comprehensive range of training programs, including Full Stack Web Development, App Development, Graphic Designing, WordPress Development, Digital Marketing, Software Quality Assurance, UI/UX Design, Search Engine Optimization (SEO), Front-end Development, Business Development, Social Media Content Creation, Content Writing, Project Management, and React JS.\r\n<br/>\r\n<br/>\r\nOur courses are designed to provide students with practical learning experiences that equip them with the skills necessary to succeed in the rapidly evolving technology industry. We have experienced trainers who provide individual attention to students, guiding them to develop their technical skills, creativity, and problem-solving abilities. At ICR, we are committed to providing a one-stop-shop for students to acquire various skills under one roof, enabling them to become bread earners without any difficulty. Our mission is to empower our students to achieve their career goals and become successful IT professionals.'),
(12, 'Europe/Copenhagen', NULL, NULL, NULL, 9, 'a7f5952912-artboard-10@4x.png', '56a564b212-icr-fav.png', 'trainee_pos.jpg', NULL, 'Design Your Future with ICR - Where 1000+ Trainees Become Experts', 'Our Amazing Feature', 'Artboard_12@8x.png', ' ICR is established in the region to provide tools & resources to our students for polishing their skills, Hence making their names in the IT market.', '<a target=\'_blank\' href=\'https://goo.gl/maps/pRZmxFKJBGK71gyX6 \'>Hello World Technologies Building, Canal Rd, near The City School, Rahim Yar Khan, Punjab 64200, Pakistan</a>', '+92302-8882-969', 'info@itcentre.pk', 'https://www.facebook.com/ITCentreRYK/', 'https://www.instagram.com/itcentreryk/', 'https://www.youtube.com/@itcentreryk', 'https://pk.linkedin.com/company/icr-it-center-ryk', '#', '#', '#', '#', 'Making Great Things Possible', 'Exploring following Platforms', 'Stay connected For latest information', 'Most Reliable Technology Provider in the Region', 'Contact Us ', 'Him have deep brought life darkness firmament unto move', 'Welcome to World of Technical Knowledge', '<br/>\r\nICR is a leading IT training institute located in Rahim Yar Khan, Pakistan, which was brought to life by Hello World Technologies, a prominent software house that has been in operation since 2016. Hello World Technologies specializes in providing customized, scalable, and integrated solutions using various enterprise technologies, thereby digitally transforming businesses.\r\n<br/>\r\n<br/>\r\nWith the unprecedented increase in the demand for IT professionals after the COVID-19 outbreak, Hello World Technologies realized the urgent need for a professional platform where students could hone their IT skills and keep pace with rapidly evolving technology. As a result, ICR was established to raise the standard of software houses in the Rahim Yar Khan region.\r\n<br/>\r\n<br/>\r\nICR is committed to providing a one-stop-shop for students to acquire various skills that can enable them to be bread earners without any difficulty. We offer a wide range of training programs, including Full Stack Web Development, App Development, Graphic Designing, WordPress Development, Digital Marketing, Software Quality Assurance, UI/UX Design, Search Engine Optimization (SEO), Front-end Development, Business Development, Social Media Content Creation, Content Writing, Project Management, and React JS.\r\n<br/>\r\n<br/>\r\nAt ICR, we believe in providing our students with a practical learning experience to ensure that they are well-equipped to meet the demands of the industry. Our experienced trainers provide individual attention to students and work with them to develop their technical skills, creativity, and problem-solving abilities.\r\n<br/>\r\n<br/>\r\nIf you are looking to enhance your IT skills or kickstart your career in the field of technology, ICR is the perfect place for you. Our courses are designed to provide you with a solid foundation and enable you to become a successful IT professional. Contact us today to learn more about our training programs and kickstart your journey towards a rewarding career.', 'https://goo.gl/maps/pRZmxFKJBGK71gyX6', '<br/>\r\nICR is a leading IT training institute in Rahim Yar Khan, Pakistan, established by Hello World Technologies. We offer a comprehensive range of training programs, including Full Stack Web Development, App Development, Graphic Designing, WordPress Development, Digital Marketing, Software Quality Assurance, UI/UX Design, Search Engine Optimization (SEO), Front-end Development, Business Development, Social Media Content Creation, Content Writing, Project Management, and React JS.\r\n<br/>\r\n<br/>\r\nOur courses are designed to provide students with practical learning experiences that equip them with the skills necessary to succeed in the rapidly evolving technology industry. We have experienced trainers who provide individual attention to students, guiding them to develop their technical skills, creativity, and problem-solving abilities. At ICR, we are committed to providing a one-stop-shop for students to acquire various skills under one roof, enabling them to become bread earners without any difficulty. Our mission is to empower our students to achieve their career goals and become successful IT professionals.');
