(22, 22, 'courses', 'Best it courses in rahim yar khan,web development course in rahim yar khan,app development course in rahim yar khan,graphic designing course in rahim yar khan,wordpress development course in rahim yar khan,digital marketing course in rahim yar khan,sqa course in rahim yar khan,ui/ux design course in rahim yar khan,seo course in rahim yar khan', 1, '2023-01-23 10:47:00', 'IT Centre is the top leading IT training institute in RYK. ICR has been providing quality IT education since 2018. More than 500+ students got IT Skills.'),
(23, 23, 'enroll-now', 'it courses enrollment in rahim yar khan', 1, '2023-01-23 10:56:42', 'ICR offers best it courses in rahim yar khan. If you want to enroll any course then fill the enrollment form for it courses in rahim yar khan.'),
(24, 24, 'web-development', 'best web development course', 1, '2023-01-23 11:11:11', 'Best web development course for beginners. 1: Front-End Development (Bootstrap, React JS). 2: Back-End Development (Node JS).'),
(25, NULL, 'app-development', 'best app development course', 1, '2023-01-24 05:16:08', 'ICR is a software based training institute in Rahim Yar Khan that offers best App Development Courses. Introduction to React Native,  Environment (Project) Setup, Learn React Basics, Component, Props, State, More Essential Components.. '),
(26, 26, 'graphic-designing', 'Best graphic designing course in rahimyarkhan', 1, '2023-01-24 05:17:11', 'By knowing the worth of Graphic Designing for a brand\'s success. ICR ( IT Centre RYK )has introduced a best Graphic Designing Course for the people of Rahim Yar Khan.'),
(27, NULL, 'wordpress-development', 'Best wordpress development course', 1, '2023-01-24 05:20:29', 'To tackle the popularity of WordPress in the IT field, ICR(IT Centre Rahim Yar Khan )  has stepped in, which is a software-based training institute located in Rahim yar khan that offers Best WordPress Development Course, allowing students to improve their abilities in the field.'),
(28, NULL, 'digital-marketing', 'Best digital marketing course', 1, '2023-01-24 05:21:30', 'ICR is a software based training institute that offers best Digital Marketing Course students can enrol in to improve their abilities in the field. The Digital Marketing Course also aids students in learning the different types of advertising channels and how they can be used to target the market.'),
(29, NULL, 'software-quality-assurance', 'Best Sofware Quality Assurance Course', 1, '2023-01-24 05:22:41', 'To tackle the ongoing challenges in the SQA field, ICR, IT Centre RYK has introduced the best Software Quality Assurance Course. The SQA training course will provide in-depth knowledge of Software Quality Assurance by following the course outline, which is specially designed for beginners.'),
(30, NULL, 'ui-ux-design-course', 'Best ux/ui design course', 1, '2023-01-24 05:25:40', 'ICR (IT Center Rahim Yar Khan ) has emerged as the leading software development service in Pakistan. Continuing its legacy of empowering the IT field, it is offering one of the best demanding UI/UX Design Course.'),
(31, NULL, 'search-engine-optimization-course', 'Best SEO course', 1, '2023-01-24 05:26:34', 'Through this best SEO course offered by IT Center Rahim yar khan, students will be introduced to the fundamentals of SEO including Keyword searching, Content planning, usage of free & paid tools for keywords analysis, content optimization, and so on.');
INSERT INTO `opportunities` (`id`, `title`, `description`, `image`, `status`, `outlet_id`) VALUES
(1, 'Free Pro Course for Top Performers', '<p>ICR recognizes and rewards top performers. Our Pro-10 program offers free advanced courses to the top performers of each batch. These courses are designed to take your skills to the next level, and our instructors provide 8-hour sitting sessions to ensure you get the most out of the course.</p>', '255c32701-free-pro-course-for-top-performers.png', 1, 9),
(7, 'Job Placement', '<p>At ICR, we have established relationships with top IT companies, leveraging these connections to help our students secure job placements. We also offer outsourcing opportunities to our graduates, allowing them to work on exciting projects and gain valuable experience.</p>', 'a0cd72ce7-job-placement.png', 1, 9),
(4, 'Freelancing Session of all Courses', '<p>At ICR, we believe in empowering our students with the skills and knowledge they need to succeed in freelancing. That\'s why we offer free freelancing sessions for all our courses, by guiding how to find clients, negotiate contracts, and deliver high-quality work that meets clients\' needs.</p>', 'aa4cb57d4-freelancing-session-of-all-courses.png', 1, 9),
(8, 'Internship Opportunity', '<p>Real-world experience is invaluable for building a successful career in IT. That\'s why we offer internship opportunities for our students, allowing them to work on real projects and gain hands-on experience in a professional setting.</p>', '1677f0df8-internship-opportunity.png', 1, 9),
(5, 'Free CV Build Session', '<p>A strong resume is key to landing your dream job, and at ICR, we offer free CV build sessions to help you create a standout resume highlighting your skills and achievements. Our experienced trainers provide personalized feedback and guidance to help you craft a compelling CV that showcases your strengths.</p>', 'c70029fe5-free-cv-build-session.png', 1, 9),
(6, 'Free Counseling Session', '<p dir=\"ltr\">At ICR, we understand that choosing the right career path can be a daunting task, and that\'s why we offer free counseling sessions to our students. During these sessions, we take the time to understand your interests, skills, and career aspirations and provide you with personalized recommendations based on your unique situation. We aim to help you make an informed decision about your career path and equip you with the knowledge and tools you need to succeed.</p>\r\n<p>&nbsp;</p>', '25dcb2116-free-counseling-session.png', 1, 9),
(9, 'Mock Interviews', '<p>Preparing for a job interview can be nerve-wracking, but we offer mock interview sessions at ICR to help you feel confident and prepared. Our experienced trainers provide personalized feedback and guidance to help you improve your interview skills and land your dream job.</p>', '42aa5c229-mock-interviews.png', 1, 9),
(10, 'Final Year Project Consultancy', '<p>Your final year project is a critical component of your academic journey. At ICR, we offer consultancy services to help you develop a project that showcases your skills and knowledge. Our experienced trainers provide guidance and support to help you create a project that stands out and makes an impact.</p>', 'f9e58b4310-final-year-project-consultancy.png', 1, 9);
